        id: "51dc6e7a9ee4f426a400006f",
        all: "{\"content_entries\":[{\"id\":\"51dc6e7a9ee4f426a400006f\",\"content_type_id\":\"51dc6e769ee4f4393900003f\",\"site_id\":\"51dc6e6e9ee4f4bb5e000002\",\"_label\":\"Two\",\"slug\":\"two\",\"position\":2,\"number\":\"Two\",\"title\":\"Use Wagon to build your websites fast\",\"description\":\"<p>\\n<strong>Wagon<\/strong>  is our tool to build LocomotiveCMS sites on your local machine with your preferred text editor and without installing the full engine locally.\\n<br/>\\nNo need to be a Ruby guru, just write your pages with our super simple templating\\nlanguage, use <strong>Sass<\/strong> (with Compass) or <strong>Less<\/strong> to code your stylesheets.\\nYou can even use <strong>HAML<\/strong> to avoid typing full HTML code.\\n<br/>\\nMoreover, you are free to organize your content without a database. You also get to decide which parts your client can edit on his own so he does not mess up with your layout.\\n<br/>\\nFor instance, you need a page for your band's discography? All you need to do is to create a new \\\"recording\\\" content type with a title, year, album cover, and track listing.\\n<\/p>\\n\",\"picture\":\"/sites/51dc6e6e9ee4f4bb5e000002/content_entry51dc6e769ee4f4393900003f/51dc6e7a9ee4f426a400006f/files/wagon.png\",\"time_saver\":true},{\"id\":\"51dc6e7a9ee4f4c2d700006e\",\"content_type_id\":\"51dc6e769ee4f4393900003f\",\"site_id\":\"51dc6e6e9ee4f4bb5e000002\",\"_label\":\"One\",\"slug\":\"one\",\"position\":1,\"number\":\"One\",\"title\":\"Install the LocomotiveCMS engine <u>ONCE AND FOR ALL<\/u>\",\"description\":\"<p>\\nSince our CMS integrates the multi-site functionality from day 1, a single instance of LocomotiveCMS can serve as many websites as your server can handle.\\n<br/>\\nInstalling the engine is as simple as installing any other Ruby on Rails application.\\n<\/p>\\n\",\"picture\":\"/sites/51dc6e6e9ee4f4bb5e000002/content_entry51dc6e769ee4f4393900003f/51dc6e7a9ee4f4c2d700006e/files/installation.png\",\"time_saver\":false},{\"id\":\"51dc6e7a9ee4f4dc05000070\",\"content_type_id\":\"51dc6e769ee4f4393900003f\",\"site_id\":\"51dc6e6e9ee4f4bb5e000002\",\"_label\":\"Three\",\"slug\":\"three\",\"position\":3,\"number\":\"Three\",\"title\":\"Finally, deploy your websites\",\"description\":\"<p>\\n  Alright, your site looks good and you want your client to enter his or her content\\n  <br/>\\n  Thanks to our API, deploying your site built with Wagon to a LocomotiveCMS engine will generate a\\n  <strong>fully customized back-office<\/strong> for your clients.\\n  <br/>\\n  <br/>\\n  Don't feel like installing, managing and regularly upgrading your LocomotiveCMS engine? No problem, we can handle it for you.\\n  <br/>\\n  <br/>\\n  <a href=\\\"http://www.locomotivehosting.com\\\" class=\\\"button\\\">Try our hosting solution<\/a>\\n<\/p>\\n\",\"picture\":\"/sites/51dc6e6e9ee4f4bb5e000002/content_entry51dc6e769ee4f4393900003f/51dc6e7a9ee4f4dc05000070/files/step.png\",\"time_saver\":false}]}",
