      find: "{\"snippet\":{\"id\":\"51dc6e749ee4f40dbe00000f\",\"site_id\":\"51dc6e6e9ee4f4bb5e000002\",\"slug\":\"nav\",\"name\":\"Nav\",\"template\":{\"en\":\"<nav class='{% if page.fullpath == \\\"index\\\" %}home-nav{% endif %}' id='main-nav'>\\n  <div class='inner-container'>\\n    <h1>\\n      <a href='/'>\\n        LOCOMOTIVECMS\\n      <\/a>\\n    <\/h1>\\n    <div id='nav-toggle'>\\n      <a class='icon-th-list'><\/a>\\n    <\/div>\\n    <ul>\\n      {% assign path_segments = path | split: '/' %}\\n      {% for mainpage in site.index.children reversed %}\\n      {% if mainpage.listed? %}\\n      <li class='{% if mainpage.fullpath == path_segments[1] %}active{% endif %}'>\\n        <a href='/{{ mainpage.fullpath }}' target='{% if mainpage.redirect_url %}blank{% endif %}'>\\n          {{ mainpage.title }}\\n        <\/a>\\n      <\/li>\\n      {% endif %}\\n      {% endfor %}\\n    <\/ul>\\n  <\/div>\\n<\/nav>\\n\"}}}"
